def check_personal_substitution(substitution, group, courses):
    if group != '' and courses == '':
        if substitution.group != '':
            if group in substitution.group or substitution.group in group:
                return True
    elif group != '' and courses != '':
        if substitution.group != '' and substitution.course != '':
            if group in substitution.group or substitution.group in group:
                question_mark = substitution.course.find('?')
                if question_mark == -1:
                    if substitution.course in courses:
                        return True
                else:
                    if substitution.course[:question_mark] in courses or substitution.course[question_mark + 1:] in courses:
                        return True
    return False

