# course order: 
def get_attributes(course, colours):
    course = course.lower()
    if 'deu' in course or 'dep' in course or 'daz' in course:
        return (colours[0:1], german)
    elif 'eng' in course or 'enp' in course or 'ena' in course:
        return (colours[1:2], english)
    elif 'fra' in course or 'frf' in course or 'frz' in course:
        return (colours[2:3], french)
    elif 'spa' in course or 'spf' in course:
        return (colours[3:4], spanish)
    elif 'laa' in course or 'laf' in course or 'lat' in course:
        return (colours[4:5], latin)
    elif 'tue' in course:
        return (colours[5:6], turkish)
    elif 'chi' in course:
        return (colours[6:7], chinese)
    elif 'kun' in course:
        return (colours[7:8], arts)
    elif 'mus' in course:
        return (colours[8:9], music)
    elif 'dar' in course or 'dap' in course:
        return (colours[9:10], theatre)

    elif 'geg' in course or 'wuk' in course:
        return (colours[10:11], geography)
    elif 'ges' in course:
        return (colours[11:12], history)
    elif 'pol' in course or 'pop' in course:
        return (colours[12:13], politics)
    elif 'phi' in course or 'psp' in course:
        return (colours[13:14], philosophy)
    elif 'rel' in course:
        return (colours[14:15], religion)

    elif 'mat' in course or 'map' in course:
        return (colours[15:16], maths)
    elif 'bio' in course or 'bip' in course or 'nw' in course:
        return (colours[16:17], biology)
    elif 'che' in course or 'chp' in course:
        return (colours[17:18], chemistry)
    elif 'phy' in course or 'php' in course:
        return (colours[18:19], physics)
    elif 'inf' in course:
        return (colours[19:20], compsci)

    elif 'spo' in course or 'spp' in course or 'spth' in course:
        return (colours[20:21], physed)
    elif 'gll' in course:
        return (colours[21:22], gll)
    elif 'wat' in course:
        return (colours[22:23], wat)
    elif 'för' in course:
        return (colours[23:24], forder)
    elif 'wp' in course or 'met' in course:
        return (colours[24:25], wp)
    else:
        return ('w', nothing)

